var calendar = $('#full-calendar').fullCalendar({
  initialView: 'resourceTimelineWeek',
  dayClick: function (info) {
    info = moment(info).toISOString();
    $('#new-event').modal('show');
    $('.new-event--title').val('');
    $('.new-event--start').val(info);
    $('.new-event--end').val(info);
  },
  eventClick: function (a, b) {
    $('#edit-event').modal('show');
    $('.edit-event--id').val(a.id);
    $('.edit-event--title').val(a.title);
    $('.edit-event--description').val(a.description);
  },
});

$('.new-event--add').click(() => {
  
  var title = $('.edit-event--title').text()
  var event = { id: 1, title: title, start: calendar.select 
  };
  calendar.fullCalendar('renderEvent', event, true);
});

